import React from 'react';

const AddInterview = (props) => {
    const addUserHandler = (event) => {
        event.preventDefault();
    };

    return (
        <form onSubmit={addUserHandler}>
            <button type="submit">Create Interview</button>
        </form>
    );
};

export default AddInterview;
